package ispalindrom

class ListNode(
    val `val`: Int,
    var next: ListNode?
) {
    constructor(value: Int) : this(value, null)

    override fun equals(other: Any?): Boolean {
        if (this === other) return true
        if (javaClass != other?.javaClass) return false
        if (next != null) {
            return next!!.equals((other as ListNode).next)
        }
        return `val` == (other as ListNode).`val`
    }

    override fun hashCode(): Int {
        var result = `val`
        result = 31 * result + (next?.hashCode() ?: 0)
        return result
    }

    override fun toString(): String {
        var current = this
        var str = ""
        while (current.next != null) {
            str += current.`val`.toString()
            current = current.next!!
        }
        return str + current.`val`.toString()
    }
}

fun simpleTests() {
    assert(headFromString("[1]").equals(ListNode(1)))
    assert(headFromString("[1,2,3]").equals(ListNode(1, ListNode(2, ListNode(3)))))
    assert(headFromString("1,2,3").equals(ListNode(1, ListNode(2, ListNode(3)))))
    assert("321" == headFromString("[1,2,3]").asReversedString())
    assert("123" == headFromString("[1,2,3]").asString())
    assert("1221" == headFromString("[1,2,2,1]").asString())
    assert(failedWithString == headFromString(failedWith).asString())
    assert(timeOutedString == headFromString(timeOuted).asString())
    assert(outOfLimitString == headFromString(outOfLimit).asString())
    assert("1221" == headFromString("[1,2,2,1]").asString())
    assert(MySolution().isPalindrome(headFromString("[1,2,2,1]"))) { "Should be palindrome" }
    assert(SolutionSepRev().isPalindrome(headFromString("[1,2,3,4,5,4,3,2,1]"))) { "Should be palindrome" }
    assert(SolutionSepRev().isPalindrome(headFromString("[1,2,3,4,4,3,2,1]"))) { "Should be palindrome" }
    assert(!MySolution().isPalindrome(headFromString("[1,3]"))) { "Should not be palindrome" }
    assert(!MySolution().isPalindrome(headFromString(failedWith))) { "Should not be palindrome" }
    assert(!MySolution().isPalindrome(headFromString(timeOuted))) { "Should not be palindrome" }
    assert(!MySolution().isPalindrome(headFromString(outOfLimit))) { "Should not be palindrome" }
}

class MySolution {
    fun isPalindrome(head: ListNode?): Boolean {
        if (head == null) {
            return false
        }
        if (head.next == null) {
            return true
        }
        val size = head.size()
        val mp = size / 2 + size % 2
        var lp = mp - size % 2
        var rp = if ((size and 1) == 0) mp else mp + 1
        return false
    }
}
internal class Solution {
    fun isPalindrome(head: ListNode?): Boolean {
        if (head?.next == null) return true

        var slow = head
        var fast = head
        var prev: ListNode? = null

        // Find the middle of the linked list and reverse the first half
        while (fast?.next != null) {
            fast = fast.next!!.next
            val temp = slow!!.next
            slow.next = prev
            prev = slow
            slow = temp
        }


        if (fast != null) slow = slow!!.next
        while (prev != null && slow != null) {
            if (prev.`val` != slow.`val`) return false
            prev = prev.next
            slow = slow.next
        }

        return true
    }
}

internal class SolutionSepRev {
    fun isPalindrome(head: ListNode?): Boolean {
        var head0 = head
        if (head0?.next == null) {
            return true
        }

        var slow = head0
        var fast = head0

        while (fast?.next?.next != null) {
            slow = slow!!.next
            fast = fast.next!!.next
        }

        slow!!.next = reverseList(slow.next)

        slow = slow.next

        while (slow != null) {
            if (head0!!.`val` != slow.`val`) {
                return false
            }
            head0 = head0.next
            slow = slow.next
        }
        return true
    }

    private fun reverseList(head: ListNode?): ListNode? {
        var head0 = head
        var pre: ListNode? = null
        var next: ListNode?

        while (head0 != null) {
            next = head0.next
            head0.next = pre
            pre = head0
            head0 = next
        }
        return pre
    }
}

fun ListNode.size(): Int{
    var counter = 0
    var current = this
    while (current.next != null){
        counter++
        current = current.next!!
    }
    return counter + 1
}

fun ListNode.asString(): String{
    var current = this
    var str = ""
    while (current.next != null) {
        str += current.`val`.toString()
        current = current.next!!
    }
    return str + current.`val`.toString()
}

fun ListNode.asReversedString(): String{
    var current = this
    var str = ""
    while (current.next != null) {
        str = current.`val`.toString() + str
        current = current.next!!
    }
    return current.`val`.toString() + str
}

fun headFromString(input: String): ListNode {
    val arr = input.trim('[', ']').split(',', ' ').map { s -> s.toInt() }
    if (arr.size == 1) {
        return ListNode(arr[0])
    }
    var head: ListNode? = null
    var i = arr.size - 1
    while (i >= 0) {
        head = ListNode(arr[i], head)
        i--
    }
    return head!!
}

